    return (
        <>
        <p>{data}</p>
        <p>Name of Person : {data.name}</p>
        {/* <p>Age of Person : {state.dataage}</p>
        <p>Batch : {state.formData.databatch}</p> */}
        <p>Amount Paid : {"500 Rs"}</p>
        </>
    );
  }

